import React from "react";
class CounterClass extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            count:0
        }
    }
    render(){
        return(
            <div>
              
                <h1>hello Counter with class components</h1>
                <h1> count: {this.state.count}</h1>
            </div>
        )
    }
}

export default CounterClass
